        L"\x10100\x10101";

      const wchar_t END_OF_SENTENCE[] = L"!.?";
      
      const CharTable::Range RANGES[] =
      {
        CharTable::Range(0x3400, 0x4DB5),
        CharTable::Range(0x4E00, 0x9FCB),
        CharTable::Range(0xAC00, 0xD7A3),
        CharTable::Range(0xD800, 0xDB7F),
        CharTable::Range(0xDB80, 0xDBFF),
        CharTable::Range(0xDC00, 0xDFFF),
        CharTable::Range(0xE000, 0xF8FF),
        CharTable::Range(0x20000, 0x2A6D6),
        CharTable::Range(0x2A700, 0x2B734),
        CharTable::Range(0xF0000, 0xFFFFD),
        CharTable::Range(0x100000, 0x10FFFD)
      };
      
      CharTable::CharTable() throw(El::Exception)
      {
        set_deleted_key(0xFFFFFFFF);
        set_empty_key(0xFFFFFFFF - 1);

        wchar_t code;
        
        for(const CharDescriptor* desc = descriptors_;
            (uint32_t)(code = desc->code) != 0xFFFFFFFF; desc++)
        {
          CharInfo ci;
          ci.desc = desc;
          
          if(code)
          { 
            GeneralCategory gc = desc->general_category;

            if(gc == GC_Zs || gc == GC_Zl || gc == GC_Zp ||
               wcschr(L"\f\n\r\t\v", code) != 0)
            {
              ci.flags |= EC_SPACE;
            }

            if(gc == GC_Pd || wcschr(STOP, code) != 0)
            {
              ci.flags |= EC_STOP;
            }

            
            if((ci.flags & EC_STOP) && wcschr(END_OF_SENTENCE, code) != 0)
            {
              ci.flags |= EC_END_OF_SENTENCE;
            }

            if(gc == GC_Lu || gc == GC_Ll || gc == GC_Lt || gc == GC_Lo)
            {
              ci.flags |= EC_LETTER;
            }

            if(gc == GC_Nd || gc == GC_Nl || gc == GC_No)
            {
              ci.flags |= EC_NUMBER;
            }
            
            if(gc == GC_Pd || gc == GC_Lm ||
               gc == GC_Nd || gc == GC_Nl || gc == GC_No ||
               wcschr(L"'_&", code) != 0)
            {
              ci.flags |= EC_INTERWORD;
            }

            if(gc == GC_Pd || gc == GC_Lm ||
               wcschr(L"-+.,eE%:/#$\xA2\xA3\xA4\xA5\x20AC\x2116", code) != 0)
            {
              ci.flags |= EC_INTERNUMBER;
            }
            
            const wchar_t* ptr = wcschr(OPEN_SINGLE_QUOTE, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_SINGLE_QUOTE | EC_OPENING;
              
              ci.symmetric_code =
                CLOSE_SINGLE_QUOTE[ptr - OPEN_SINGLE_QUOTE];
            }
            
            ptr = wcschr(CLOSE_SINGLE_QUOTE, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_SINGLE_QUOTE | EC_CLOSING;
              
              ci.symmetric_code =
                OPEN_SINGLE_QUOTE[ptr - CLOSE_SINGLE_QUOTE];
            }
            
            ptr = wcschr(OPEN_MULTI_QUOTE, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_MULTI_QUOTE | EC_OPENING;
              
              ci.symmetric_code =
                CLOSE_MULTI_QUOTE[ptr - OPEN_MULTI_QUOTE];
            }
            
            ptr = wcschr(CLOSE_MULTI_QUOTE, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_MULTI_QUOTE | EC_CLOSING;
              
              ci.symmetric_code =
                OPEN_MULTI_QUOTE[ptr - CLOSE_MULTI_QUOTE];
            }
            
            ptr = wcschr(OPEN_BRACKET, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_BRACKET | EC_OPENING;
              ci.symmetric_code = CLOSE_BRACKET[ptr - OPEN_BRACKET];
            }
            
            ptr = wcschr(CLOSE_BRACKET, code);
            
            if(ptr != 0)
            {
              ci.flags |= EC_BRACKET | EC_CLOSING;
              ci.symmetric_code = OPEN_BRACKET[ptr - CLOSE_BRACKET];
            } 
          }
          
          insert(std::make_pair(code, ci));
        }

        for(size_t i = 0; i < sizeof(RANGES) / sizeof(RANGES[0]); i++)
        {
          ranges_.push_back(RANGES[i]);
          RangeArray::reverse_iterator it = ranges_.rbegin();

          const_iterator cit = find(it->first);
          assert(cit != end());
          
          it->info = &cit->second;
        }

        begin_ranges_ = ranges_.begin();
        end_ranges_ = ranges_.end();

        for(iterator it = begin(); it != end(); it++)
        {
          wchar_t code = it->first;

          switch(code)
          {
          case 0x451:
          case 0x401:
            {
              // russian yo,YO -> e
              normal_representation_[code] = L"\x435";
              continue;
            }
          case 0x96:
          case 0x97:
          case 0x2010:
          case 0x2011:
          case 0x2012:
          case 0x2013:
          case 0x2014:
            {
              // abormal hyphens -> -
              normal_representation_[code] = L"\x2D";
              continue;
            }
          }
          
          CharInfo& ci = it->second;
          const CharDescriptor* desc = ci.desc;

          if(desc->decomposition && (ci.flags & (EC_LETTER | EC_NUMBER)) != 0)
          {
            std::wstring norm_repr;
            norm_repr += code;

//            bool norm = false;
            
            if(normalize(norm_repr))
            {
              normal_representation_[code] = norm_repr;
//              norm = true;
            }
          }
        }
      }
      
      bool
      CharTable::normalize(std::wstring& norm_repr) throw(El::Exception)
      {
        while(true)
        {
          std::wstring new_repr;
          new_repr.reserve(norm_repr.length());
        
          for(std::wstring::const_iterator it = norm_repr.begin();
              it != norm_repr.end(); it++)
          {
            wchar_t code = *it;
          
            const CharInfo* ci = info(code);
            assert(ci != 0);

            bool decomposed = false;
              
            const char* decomposition = ci->desc->decomposition;
          
            if(decomposition)
            {
              El::String::ListParser parser(decomposition);

              const char* item;
            
              while((item = parser.next_item()) != 0)
              {
                unsigned long tmp;
              
                if(El::String::Manip::numeric(item,
                                              tmp,
                                              El::String::Manip::NF_HEX))
                {
                  wchar_t subcode = tmp;                
                  const CharInfo* sub_ci = info(subcode);
                
                  assert(sub_ci != 0);

                  switch(subcode)
                  {
                  case L'/':
                  case L'(':
                  case L')':
                  case L'.':
                  case L',': break;
                  default:
                    {
                      if((sub_ci->flags & (EC_LETTER | EC_NUMBER)) == 0)
                      {
                        // Do not decompose char into peaces other than
                        // letters and numbers as it will cut off letter
                        // modifiers making impossible to guess language for
                        // word. Meanwhile this need to be fixed as as a reult
                        // same word with letters in different representation
                        // will be considered different in applications.
                        
//                        continue;
                        return false;
                      }
                      
                      break;
                    }
                  }

                  if((sub_ci->flags & (EC_LETTER | EC_NUMBER)) ||
                     subcode == 0x2044)
                  {
                    new_repr += subcode == 0x2044 ? L'/' : subcode;
                    decomposed = true;
                  }
                }
              }  
            }

            if(!decomposed)
            {
              new_repr += code;
            }
          }

          if(new_repr == norm_repr)
          {
            break;
          }
          else
          {
            norm_repr.swap(new_repr);
          }
        }

        for(std::wstring::iterator i(norm_repr.begin()),
            e(norm_repr.end()); i != e; ++i)
        {
          wchar_t& code = *i;        
          CharTable::const_iterator it = find(code);

          if(it != end())
          {
            wchar_t lc = it->second.desc->lower_case;

            if(lc)
            {
              code = lc;
            }
          }
        }

        return true;
      }
      
      void
      CharTable::to_lower(const wchar_t* src, std::wstring& dest)
        throw(El::Exception)
      {
        if(src == 0 || *src == L'\0')
        {
          dest.clear();
          return;
        }

        dest.resize(wcslen(src));

        wchar_t chr;
        for(size_t i = 0; (chr = *src++) != L'\0'; )
        {
          dest[i++] = to_lower(chr);
        }
      }

